const http = require('http');
const url = require('url');
const fetch = require('node-fetch');
const SongCard = require('./src/SongCard');
const { asyncForEach } = require('./src/utils');
const lastfmAPI = require('./src/lastfmApi');
const { userRecentTracks } = require('./src/lastfmApi');

http.createServer(async (req, res) => {
  const reqURL = url.parse(req.url, true);
  const { username, limit } = reqURL.query;
  const timestamp = Math.floor(Date.now() / 1000);
  let articles = [];

  if (!username) {
    res.write(JSON.stringify({"ðŸ‘‹": 'Add your last.fm username as query string'}));
    res.end();
    return;
  }

  const responseSongs = await userRecentTracks(username);

  if (!responseSongs || responseSongs.length === 0) {
    res.write(JSON.stringify({error: 'You dont have anything on last.fm.'}));
    res.end();
    return;
  }

  if (limit) {
    songs = [...responseSongs.songs.slice(0, limit)];
  } else {
    songs = [responseSongs.songs[0]];
  }

  let result = `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="600px" version="1.2" height="${songs.length * 150}">
  <defs xmlns="http://www.w3.org/2000/svg">
  <filter id="Blur">
    <feGaussianBlur in="SourceGraphic" stdDeviation="10" />
  </filter>
  <style>
  @font-face {
    font-family: 'Noto Sans JP';
    src: url(data:application/font-woff;charset=utf-8;base64,) format('woff');
    font-weight: normal;
    font-style: normal;

}
  @font-face {
    font-family: 'Inter';
    src: url(data:application/x-font-woff;charset=utf-8;base64,) format('woff');
    font-weight: normal;
    font-style: normal;
}
  </style>
  </defs>`
  
  await asyncForEach(songs, async (song, index) => {
    const songCard = await SongCard(song);
    result += `<g transform="translate(0, ${index * 150})">${songCard}</g>`;
  });

  result += `</svg>`;

  res.setHeader('Cache-Control', 's-maxage=60');
  res.setHeader('Expires', '-1');
  res.setHeader('Pragma', 'no-cache');
  res.writeHead(200, { 'Content-Type': 'image/svg+xml' });

  res.write(result);
  res.end();
}).listen(process.env.PORT || 3000, function(){
 console.log("server start at port 3000");
});